import React, { Component } from "react";
import ReactDOM from "react-dom";
import LatestCount from "./LatestCount";
import olinCounts from "./imgs/olinCounts.png";

class Dashboard extends Component {
      constructor(props) {
            super(props);

            this.state = {
                  NWCubbies: 2,
                  SWCubbies: 121,
                  gingkoRoom: 21,
                  roomA03: 12,
                  roomA30: 12,
                  newman: 0,
                  skyRoom: 0,
                  risalanding: 0,
                  room326: 0
            };

            this.closeDashboard = this.closeDashboard.bind(this);
            this.getLatestRoomCounts = this.getLatestRoomCounts.bind(this);
            this.setDisplayStates = this.setDisplayStates.bind(this);
            this.componentDidMount = this.componentDidMount.bind(this);
      }

      getLatestRoomCounts() {
            fetch("http://localhost:5000/sendLatestRoomCounts")
                  .then(res => res.text())
                  .then(res => this.setDisplayStates(JSON.parse(res))); 
      }

      setDisplayStates(response) {


      }

      closeDashboard() {
            ReactDOM.render(
                  <LatestCount />,
                  document.getElementById("mainContent")
            );
      }

      componentDidMount() {
            this.getLatestRoomCounts();

      }
                  
      
      render() {
            return (
                  <>
                        <div className="dashboard">
                              <div className="dashboardHeader">
                                    <img
                                          src={olinCounts}
                                          class="dashboardLogo"
                                          alt="logo"
                                    />
                                    <button
                                          type="button"
                                          class="btn btn-danger dashboardCloseButton"
                                          onClick={this.closeDashboard}
                                    >
                                          X
                                    </button>
                              </div>

                              <div class="dashboardDisplayContainer">
                                    <div class="dashboardDisplay">
                                          <h2> NW Cubbies </h2>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                           <h3> SW Cubbies </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                    <h3> Gingko Room </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                    <h3> A03 </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                    <h3> A30 </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                    <h3> Newman Exploration Center </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                    <h3> Risa's Landing </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    <div class="dashboardDisplay">
                                    <h3> Sky Room </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>

                                    
                                    <div class="dashboardDisplay">
                                    <h3> 326 (Graduate-Study) </h3>
                                          <div class="w3-border">
                                           <div class="nwcubbies-w3-grey"></div>
                                          </div>
                                    </div>
                              </div>
                        </div>
                  </>
            );
      }
}

export default Dashboard;
